//import PoreCompoent for preventing unnecesary updates. 
import React, { PureComponent } from 'react';
//import your components from react-native 
import { View,Image,  FlatList, TouchableOpacity, Text, ActivityIndicator } from 'react';
//import styles for your component

export default class ListaConsulta extends PureComponent {
    //Define your state for your component. 
    state = {
        //Assing a array to your pokeList state
        listaConsulta: [],
        //Have a loading state where when data retrieve returns data. 
        loading: true
    }
    //Define your componentDidMount lifecycle hook that will retrieve data.
    //Also have the async keyword to indicate that it is asynchronous. 
    async componentDidMount() {
        //Have a try and catch block for catching errors.
        try {
            //Assign the promise unresolved first then get the data using the json method. 
            const apiCall = await fetch('http://localhost:5000/enquiries');
            const consulta = await apiCall.json();
            this.setState({listaConsulta: consulta.results, loading: false});
        } catch(err) {
            console.log("Error fetching data-----------", err);
        }
    }

}
